import React from 'react'
import { Navbar, NavItem } from 'react-materialize';

class AccountBar extends React.Component{
    render(){
        return(
            <div>
               <Navbar brand={<a href="google.com"/>} alignLinks="right">
                    <NavItem href="yahoo.com">
                        Getting started
                        </NavItem>
                        <NavItem href="tumblr.com">
                        Components
                    </NavItem>
                </Navbar>
            </div>
        )
    }
}

export default AccountBar
